import { __decorate } from "tslib";
import { Component } from '@angular/core';
let UserProfileComponent = class UserProfileComponent {
    constructor(cheetaUsersService, fileUploaderService) {
        this.cheetaUsersService = cheetaUsersService;
        this.fileUploaderService = fileUploaderService;
        //variable names taken for edit
        this.name = "";
        this.mobile = '';
        this.email = '';
        this.type = "";
        this.url = '';
    }
    async ngOnInit() {
        const res = await this.cheetaUsersService.getUserData();
        await this.updateUi(res.data);
    }
    //filepicker function for updating profile pic
    async onFilePicked(event) {
    }
    //funtion usedon click of edit option
    onEdit() {
        const userProfile = {
            name: this.name,
            mobile: this.mobile,
            profilePic: this.profilePic,
            type: this.type,
        };
        this.cheetaUsersService.updateUser(userProfile);
    }
    updateUi(userObj) {
        this.name = userObj.name;
        this.mobile = userObj.mobile;
        this.email = userObj.email;
        this.type = userObj.type;
        this.profilePic = userObj.profilePic;
    }
};
